const rolled={one:0,two:0};$(function(){const e=1e3;$("a").click(function(e){e.preventDefault()});const i=$("#die-1").dice({duration:e,imageUrl:"./assets/img/dice.png",value:6}),c=$("#die-2").dice({duration:e,imageUrl:"./assets/img/dice.png",value:6});$("#dice").click(function(){i.dice("roll",e=>rolled.one=e),c.dice("roll",e=>rolled.two=e)})});